import logo from './logo.svg';
import './App.css';
import FetchData from './Api/FetchData';
import { QueryClientProvider} from 'react-query';

function App() {
  return (
    <QueryClientProvider>
    <div className="App">
     <FetchData></FetchData>
    </div>
    </QueryClientProvider>
  );
}

export default App;
